import 'package:flutter/material.dart';

class Brasileira extends StatelessWidget {
  const Brasileira({Key? key}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    final altura = MediaQuery.of(context).size.height;
    final largura = MediaQuery.of(context).size.width;

    final largcont = (largura) / 1.2;
    final altucont = (altura) / 4;
    print(altura);
    print(largura);
    print(largcont);
    print(altucont);

    return Scaffold(
      appBar: AppBar(
        title: Text('Culianaria Brasileira'),
        actions: [
          PopupMenuButton(
            onSelected: (value) {
              if (value == '/italiana') {
                Navigator.of(context).pushNamed('/receita/italiana');
              } else if (value == '/brasileira') {
                Navigator.of(context).pushNamed('/receita/brasileira');
              } else if (value == '/home') {
                Navigator.popUntil(context, ModalRoute.withName('/receitas'));
              }
            },
            itemBuilder: (context) => [
              PopupMenuItem(
                child: Text('Home'),
                value: '/home',
              ),
              PopupMenuItem(
                child: Text('Italiana'),
                value: '/italiana',
              ),
              PopupMenuItem(
                child: Text('Brasileira'),
                value: '/brasileira',
              ),
            ],
          )
        ],
      ),
      body: Column(
        children: [
          Scrollbar(
              isAlwaysShown: true,
              thickness: 10,
              radius: Radius.circular(20),
              scrollbarOrientation: ScrollbarOrientation.left,
              child: Center(
                  child: Column(
                children: [
                  Container(
                    margin: const EdgeInsets.fromLTRB(0, 5, 0, 5),
                    width: (largcont),
                    height: (altucont),
                    child: ElevatedButton(
                        onPressed: () {
                          Navigator.of(context)
                              .pushNamed('/receita/brasileira/frangocomquiabo');
                        },
                        child: Column(
                          children: [
                            Image.network(
                              'data:image/jpeg;base64,',
                              height: altucont - 20,
                              width: largcont,
                            ),
                            Text('Frango com Quiabo')
                          ],
                        )),
                  ),
                  Container(
                    margin: const EdgeInsets.fromLTRB(0, 5, 0, 5),
                    width: (largcont),
                    height: (altucont),
                    child: ElevatedButton(
                        onPressed: () {
                          Navigator.of(context)
                              .pushNamed('/receita/brasileira/feijoada');
                        },
                        child: Column(
                          children: [
                            Image.network(
                              'data:image/jpeg;base64,',
                              height: altucont - 20,
                              width: largcont,
                            ),
                            Text('Feijoada')
                          ],
                        )),
                  ),
                ],
              )))
        ],
      ),
    );
  }
}
